!COFF
header: !Header
  Machine: IMAGE_FILE_MACHINE_R4000 # (0x166)
  Characteristics: [ IMAGE_FILE_DEBUG_STRIPPED ]

sections:
  - !Section
    Name: .text
    Characteristics: [ IMAGE_SCN_CNT_CODE, IMAGE_SCN_MEM_EXECUTE, IMAGE_SCN_MEM_READ ]
    Alignment: 4
    SectionData:  E8FFBD271400BFAF0000013C0000000C000024240000000C00000000000002241400BF8F0800E0031800BD27

    Relocations:
      - !Relocation
        VirtualAddress: 8
        SymbolName: str
        Type: IMAGE_REL_MIPS_REFHI

      - !Relocation
        VirtualAddress: 8
        SymbolName: .text
        Type: IMAGE_REL_MIPS_PAIR

      - !Relocation
        VirtualAddress: 12
        SymbolName: puts
        Type: IMAGE_REL_MIPS_JMPADDR

      - !Relocation
        VirtualAddress: 16
        SymbolName: str
        Type: IMAGE_REL_MIPS_REFLO

      - !Relocation
        VirtualAddress: 20
        SymbolName: SomeOtherFunction
        Type: IMAGE_REL_MIPS_JMPADDR

  - !Section
    Name: .rdata
    Alignment: 1
    Characteristics: [ IMAGE_SCN_CNT_INITIALIZED_DATA, IMAGE_SCN_MEM_READ ] # 0xc0100040
    SectionData:  !hex "48656C6C6F20576F726C642100" # |Hello World!.|

symbols:
  - !Symbol
    Name: main
    Value: 0
    SectionNumber: 0
    SimpleType: IMAGE_SYM_TYPE_NULL
    ComplexType: IMAGE_SYM_DTYPE_NULL
    StorageClass: IMAGE_SYM_CLASS_EXTERNAL

  - !Symbol
    Name: str
    Value: 0
    SectionNumber: 1
    SimpleType: IMAGE_SYM_TYPE_NULL
    ComplexType: IMAGE_SYM_DTYPE_NULL
    StorageClass: IMAGE_SYM_CLASS_EXTERNAL

  - !Symbol
    Name: puts
    Value: 0
    SectionNumber: 0
    SimpleType: IMAGE_SYM_TYPE_NULL
    ComplexType: IMAGE_SYM_DTYPE_NULL
    StorageClass: IMAGE_SYM_CLASS_EXTERNAL

  - !Symbol
    Name: SomeOtherFunction
    Value: 0
    SectionNumber: 0
    SimpleType: IMAGE_SYM_TYPE_NULL
    ComplexType: IMAGE_SYM_DTYPE_NULL
    StorageClass: IMAGE_SYM_CLASS_EXTERNAL
